import React from "react";

let g_index;
let u_index;
let procent;
export function sendIndex(global_index, user_index){
    g_index = global_index;
    u_index = user_index;
}

export function getProcent(){
    procent = (u_index * 100)/g_index;
    return procent;
}



export default function Dashboard() {
  return(
    <h2>Dashboard</h2>
  );
}
